- " ```def f(n, k):\n    a = list(map(int, input().split()))\n    a.sort()\n    res\
  \ = 0\n    for i in range(k):\n        res += a[i] // a[i + 1]\n    return res %\
  \ 1000000007\n\nt = int(input())\nfor _ in range(t):\n    n, k = map(int, input().split())\n\
  \    print(f(n, k))\n``` Q:"
- " ```import heapq\n\nt = int(input())\nfor _ in range(t):\n    n, k = map(int, input().split())\n\
  \    a = list(map(int, input().split()))\n    heapq.heapify(a)\n    score = 0\n\
  \    for _ in range(k):\n        a_i = heapq.heappop(a)\n        a_j = heapq.heappop(a)\n\
  \        score += a_i // a_j\n    score += sum(a)\n    print(score % 1000000007)```\
